import React from 'react'
import ReactDOMServer from 'react-dom/server'
import {Flex, Box} from 'reflexbox';

const AppLoading = () => {
	return (
		<div className="prerender-loading">
			<Flex align='center' justify="center" style={{width: '100%', height: '80vh'}}>
				<Box>
					<span><img src="data:image/gif;base64,
" alt="Loading"/></span>
				</Box>
			</Flex>
		</div>
	)
};

exports.prerender = function () {
	return ReactDOMServer.renderToString(
		<AppLoading />)
};


